const MultiForm = formType => {
	return (
		<div className="multi-form">
			<div className="tlwrapper">
				<ol>
					<li>step one</li>
					<li>step two</li>
					<li>step three</li>
					<li>step four</li>
				</ol>
			</div>
			<form>
				<div className="slide">
					<h2>test</h2>
				</div>
				<div className="slide">
					<h2>test2</h2>
				</div>
			</form>
			<style jsx>{`
				.multi-form {
					height: 100%;
					width: 100%;
					display: block;
				}
			`}</style>
		</div>
	);
};

export default MultiForm;
